import 'dart:convert';enum Type {  set,  lavash,  shaurma,  donar,  xaggi,  burgers,  hotDog,  garniri,  souse,  napitk,  deserts,  morojonoe,}List<Foods> listFromJson(List map) {  List result = [];  List<Foods> foods = map.map((e) =>      Foods.fromJson(          e))      .toList();  return foods;}class Foods {  final String name;  final String image;  final String price;  final String about;  final bool have;  final String id;  final String type;  int count = 0;  Foods(      {required this.id, required this.name, required this.image, required this.price, required this.about, required this          .type, required this          .have});  Foods.fromJson(Map<String, dynamic> json)      : name = json['name'],        image = json['image'],        id = json['id'],        price = json['price'],        type =json['type'],        about =json['about'],        have =json['have'],        count =json['count'] ?? 0;  Map<String, dynamic> toJson() =>      {        'name': name,        'image': image,        'price': price,        'about': about,        'type': type,        'have': have,        'count': count,        'id': id,      };  @override  String toString() {    return 'Foods{name: $name, image: $image, price: $price, about: $about}';  }}